import { InfoWrapper, Form, Button, Text } from "./Searchbar.styled";
import { ReactComponent as Loop } from "../Icons/iconloop.svg";

export const Searchbar = ({ value, onChange, onSear }) => {

	return (
		<InfoWrapper >
			<Form >
				<Button type="submit" >
					<Loop />

				</Button>

				<Text
					className="input"
					type="text"
					autocomplete="off"
					autofocus
					placeholder="Search images and photos"
					value={value}
					onChange={onChange}
				/>
			</Form>
		</InfoWrapper>
	)
}
